class CardComponent {
    constructor() {
        this.number = '';
        this.name = '';
        this.brand = '';
        this.expiry = '';
        this.cvv = '';
        this.type = 'visa';
        this.back = false;
        this.number_parts = [];
        this.flip = false;
        this.show_back = false;
    }
    ngOnChanges(changes) {
        if (changes.number) {
            this.updateNumber();
        }
        if (changes.back) {
            this.flipCard();
        }
    }
    updateNumber() {
        if (this.number) {
            this.number_parts = this.number.split('-');
        }
    }
    flipCard() {
        this.flip = true;
        setTimeout(() => {
            this.show_back = this.back;
            setTimeout(() => this.flip = false, 250);
        }, 250);
    }
}


